import { PayloadAction, createSlice, createAsyncThunk } from "@reduxjs/toolkit";
import axios, { AxiosResponse, AxiosError } from "axios";
import { tenmien } from "../../../utils";

// import { createJsxSelfClosingElement } from "typescript";

interface brandData {
  id: number;
  name: string;
  thumbnail: string;
}
interface brandState {
  loading: boolean;
  error: string;
  data: brandData[]
}
// Fetch tat ca branch cua danh muc lon
export const fetchBrandCateGroup = createAsyncThunk(
  "brandSlice/fetchBrandCateGroup",
  (id: number) => {
    return axios
      .get(tenmien + "/api/danhmuc/" + id + "/thuonghieu")
      .then((response) => response.data);
  }
);

export const fetchBrandCate = createAsyncThunk(
  "brandSlice/fetchBrandCate",
  async (id:number) => {
    try {
      const response = await axios.get(tenmien + "/api/danhmucnho/"+id+"/thuonghieu");
      return response.data;
    } catch (err) {
      throw err;
    }
  }
);



const initialState: brandState = {
  data: [],
  loading: false,
  error: "",
};
const brandSlice = createSlice({
  name: "brand",
  initialState,
  reducers: {
    // 
  },
  extraReducers: (builder) => {
    builder.addCase(fetchBrandCateGroup.pending, (state) => {
      state.loading = true;
      state.error = "";
      state.data = [];
    });
    builder.addCase(fetchBrandCateGroup.fulfilled, (state, action) => {
      state.loading = false;
      state.data = action.payload;
    });
    builder.addCase(fetchBrandCateGroup.rejected, (state, action) => {
      state.loading = false;
      state.data = [
        {
          id: 1,
          name: "ChinSu",
          thumbnail:
            "data:image/png;base64,",
        },
        {
          id: 2,
          name: "Hảo Hảo",
          thumbnail:
            "data:image/png;base64,",
        },
        {
          id: 3,
          thumbnail: "data:image/jpeg;base64,",
          name: "3 Miền"
        },
        {
          id: 4,
          name: "Nam Ngư",
          thumbnail: "data:image/jpeg;base64,"
        }
      ];
      state.error = action.error.message || "Some thing wrong!";
    });
    // Fetch category brand
    builder.addCase(fetchBrandCate.pending, (state) => {
      state.loading = true;
      state.error = "";
      state.data = [];
    });
    builder.addCase(fetchBrandCate.fulfilled, (state, action) => {
      state.loading = false;
      state.data = action.payload;
    });
    builder.addCase(fetchBrandCate.rejected, (state, action) => {
      state.loading = false;
      state.data = [
        {
          id: 10,
          name: "Merino",
          thumbnail:
            "data:image/png;base64,",
        },
        {
          id: 12,
          name: "Masan",
          thumbnail:
            "data:image/png;base64,",
        },
      ];
      state.error = action.error.message || "Some thing wrong!";
    });
  },
});

export const brandActions = brandSlice.actions;
export default brandSlice;
